export default{
    name: "createCitysdkKeyBundle",
    // getReducer:() =>{
    // return (state, {type, payload}) =>{
    //     switch(type){
    //         case 'SET_CITYSDK_KEY_BUNDLE':
    //         return Object.assign({}, state, payload)
    //         default:
    //         return state;
    //     }
    // }
    // },
    createCitysdkKeyBundle: (key) =>({dispatch, store})=>{
        //dispatch({type: 'SET_CITYSDK_KEY_BUNDLE', payload: { citysdkStatsKey: key}})
        return{
            name: "citysdkKey",
            getReducer:() =>{
                const initialData = {
                    citysdkStatsKey: key,
                }
                return (state = initialData, {type, payload}) =>{
                    switch(type){
                        case 'SET_CITYSDK_STATS_KEY':
                        return Object.assign({}, state, payload)
                        default:
                        return state;
                    }
                }
                },
                selectCitysdkStatsKey: (state) =>{
                    return state.citysdkKey.citysdkStatsKey;
                }
        }
        
    }
}
